  input: '"TEXT","F3XN","C00235655","The Bluegrass Committee has reported a receipt
    from FMR Corporation PAC on 11/17/06 for $2,500.  This contribution is a replacement
    contribution from FMR Corporation PAC.  The FMR Corporation PAC originally made
    a contribution to the Bluegrass Committee on 12/14/05.  Unfortunately, the Bluegrass
    Committee was having a problem getting its mail delivered by the US Postal Service
    and therefore the FMR Corporation PACs check never made it to the Bluegrass Committee.  Apparently,
    mail was only being delivered if it was addressed to a specific person at the
    Bluegrass Committee.  This matter has been resolved.  The FMR Corporation PAC
    has issued a replacement check and it should be counted for the 2005 calendar
    year..  The FMR Corporation PAC has also provided a copy of the stop payment confirmation
    and it is currently in our files.  We have also been given a statement by the
    PAC that explains that the check is a replacement check for the lost contribution
    made on 12/14/05.  We have used FEC AO 1999-23 for guidance and we have communicated
    with Deborah Chacona, Branch Chief, Party/Non-Party Branch of the Reports Analysis
    Division of the FEC.  This is not an excessive contribution for the 2006 calendar
    year.    The Bluegrass Committee disclosed a voided check to the Denali PAC.  That
    contribution was originally made on 7/26/06.    The Bluegrass Committee received
    earmarked contributions and passed them on to the recipient candidate committees
    in the form of the donors check.  We have reported the receipt and disbursement
    of those contributions as memo entries on Schedules A and B.  The Bluegrass Committee
    did not exercise any direction or control over these earmarked contributions.  The
    Bluegrass Committee made a contribution to Lisa Murkowski for US Senate for the
    2010 Primary.  Our software is not disclosing the correct calendar year.    There
    were no expenditures made on behalf of specifically identified federal candidates
    on Schedule B, supporting Line 21(b).  These payments are on the appropriate line
    and Schedules B and E for Lines 23 and 24 are not required.  "'
